INSERT [dbo].[Brand] ([ID], [UserName], [PasswordHash], [PasswordSalt], [Name], [FirebaseUID], [Email], [PhoneNumber], [Status], [Description], [RejectMessage], [AvatarFileID], [AvatarLink], [IndustryID], [RegistrationNumber]) VALUES (CAST(1 AS Decimal(18, 0)), N'highland', NULL, NULL, N'Highlands coffee', NULL, N'highland@gmail.com', N'0582659544', 2, N'<p><span style="font-size: 16px; font-family: Roboto, sans-serif; color: rgb(54, 54, 54);">Highlands có cho mình những dòng sản phẩm hết sức đa dạng, đi kèm đó là không gian được trang trí một cách đơn giản, tinh tế. Điểm đặc biệt của thương hiệu này là khâu phân loại thủ công để lọc ra những hạt cà phê chất lượng nhất. Dù có giá thành khá cao nhưng bù lại sự đẳng cấp, Highlands Coffee luôn giữ cho mình vị thế vốn có.</span></p>', N'', N'639f456ce809dd54b0316c2b', N'https://ik.imagekit.io/CRealEstate/60_OZ5ee5Bjn.png', CAST(1 AS Decimal(18, 0)), N'6001665872')
INSERT [dbo].[Brand] ([ID], [UserName], [PasswordHash], [PasswordSalt], [Name], [FirebaseUID], [Email], [PhoneNumber], [Status], [Description], [RejectMessage], [AvatarFileID], [AvatarLink], [IndustryID], [RegistrationNumber]) VALUES (CAST(2 AS Decimal(18, 0)), N'thecoffeehouse', NULL, NULL, N'The Coffee House', NULL, N'thecoffeehouse@gmail.com', N'0359595948', 2, N'<p><span style="font-size: 16px; font-family: Roboto, sans-serif; color: rgb(54, 54, 54);">Ra đời muộn hơn so với những tên tuổi kể trên, tuy nhiên The Coffee House được đông đảo người dùng ưa chuộng, đặc biệt là các bạn trẻ. Không chỉ mang hình thức hiện đại, tinh tế mà chất lượng sản phẩm cũng như cách phục vụ cũng là một điểm cộng khiến The Coffee House luôn tấp nập, đông khách.</span></p>', NULL, N'639a84a0e809dd54b02c6ebe', N'https://ik.imagekit.io/CRealEstate/21_PsH-qofXR.jpg', CAST(1 AS Decimal(18, 0)), N'0316664039')
INSERT [dbo].[Brand] ([ID], [UserName], [PasswordHash], [PasswordSalt], [Name], [FirebaseUID], [Email], [PhoneNumber], [Status], [Description], [RejectMessage], [AvatarFileID], [AvatarLink], [IndustryID], [RegistrationNumber]) VALUES (CAST(3 AS Decimal(18, 0)), N'phuclong', NULL, NULL, N'Phúc Long', NULL, N'phuclong@gmail.com', N'0594959588', 2, N'<p><span style="font-size: 16px; font-family: Roboto, sans-serif; color: rgb(54, 54, 54);">Đã tồn tại khá lâu ở Việt Nam, thương hiệu Phúc Long luôn được biết đến là nơi sử dụng tâm huyết để phục vụ khách hàng. Tại đây, không gian quán, cách phục vụ giúp chúng ta nhận ra giá trị đích thực của cà phê và trà. Cà phê Phúc Long có chất riêng, mùi thơm đặc trưng, độ sánh vừa phải. Đây là lý do giúp nhãn hàng này ngày càng được ưa chuộng và xuất hiện nhiều hơn tại các trung tâm thương mại lớn.</span></p>', NULL, N'639a84aae809dd54b02c83e8', N'https://ik.imagekit.io/CRealEstate/20_7YTEBG-gz.jpg', CAST(1 AS Decimal(18, 0)), N'0302108546')
INSERT [dbo].[Brand] ([ID], [UserName], [PasswordHash], [PasswordSalt], [Name], [FirebaseUID], [Email], [PhoneNumber], [Status], [Description], [RejectMessage], [AvatarFileID], [AvatarLink], [IndustryID], [RegistrationNumber]) VALUES (CAST(4 AS Decimal(18, 0)), N'gongcha', NULL, NULL, N'Gong Cha', NULL, N'gongcha@gmail.com', N'0306119595', 2, N'<p>Tên gọi Gong Cha xuất phát từ ý nghĩa trong tiếng Hoa là Trà cung đình. Thời xưa, các loại trà tốt nhất thường được các vị hoàng thân quý tộc ngự dùng. Ngày nay, Gong Cha mong muốn phục vụ các loại trà tốt nhất cho thực khách, cũng như chính tên gọi của thương hiệu. Kể từ khi được thành lập vào năm 2006 tại Đài Loan, chuỗi cửa hàng Gong Cha đã mở rộng trên khắp 19 quốc gia với 1.500 cửa hàng và con số này vẫn tiếp tục tăng trưởng không ngừng. Qua nhiều năm nỗ lực phát triển, Gong Cha đã trở nên phổ biến với khách hàng từ nhiều quốc gia và trở thành một trong những thương hiệu trà đáng tin cậy hàng đầu trên thế giới.</p>', N'', N'639a84b4e809dd54b02ca41f', N'https://ik.imagekit.io/CRealEstate/22_3QRkYaC5Q.jpg', CAST(2 AS Decimal(18, 0)), N'0107844687')
INSERT [dbo].[Brand] ([ID], [UserName], [PasswordHash], [PasswordSalt], [Name], [FirebaseUID], [Email], [PhoneNumber], [Status], [Description], [RejectMessage], [AvatarFileID], [AvatarLink], [IndustryID], [RegistrationNumber]) VALUES (CAST(5 AS Decimal(18, 0)), N'chickenplus', NULL, NULL, N'Chicken Plus', NULL, N'chickenplus@gmail.com', N'0934984388', 2, N'<p><span style="background-color: rgb(255, 255, 255); font-size: 17.6px; font-family: Roboto, sans-serif; color: rgb(51, 51, 51);">Chicken Plus là thương hiệu gà rán nổi tiếng ở Hàn Quốc với lịch sử hình thành hơn 30 năm. Hiện nay thương hiệu này đã có gần 500 cửa hàng tại Hàn Quốc, Việt Nam, Nhật Bản, Malaysia, Indonesia…</span></p>', N'', N'639f37f7e809dd54b01770ee', N'https://ik.imagekit.io/CRealEstate/images_cse3WnOFs.png', CAST(3 AS Decimal(18, 0)), N'3703016506')
