INSERT [dbo].[Brand] ([ID], [UserName], [PasswordHash], [PasswordSalt], [Name], [FirebaseUID], [Email], [PhoneNumber], [Status], [Description], [RejectMessage], [AvatarFileID], [AvatarLink], [IndustryID], [RegistrationNumber]) VALUES (CAST(11 AS Decimal(18, 0)), N'kfc', NULL, NULL, N'KFC', NULL, N'kfc@gmail.com', N'0934123583', 2, N'<p>Kentucky Fried Chicken, thường được biết đến với tên gọi tắt là KFC, là một chuỗi cửa hàng đồ ăn nhanh của Mỹ chuyên về các sản phẩm gà rán có trụ sở đặt tại Louisville, Kentucky. Đây là chuỗi nhà hàng lớn thứ hai thế giới và chỉ đứng sau McDonald&#39;s với tổng cộng gần 20.000 nhà hàng tại 123 quốc gia và vùng lãnh thổ.</p>', N'', N'639f3571e809dd54b01300b9', N'https://ik.imagekit.io/CRealEstate/1200px-Logo_KFC.svg_CvSkmXgeZ.png', CAST(3 AS Decimal(18, 0)), N'0100773885')
