INSERT [dbo].[Project] ([ID], [Status], [Description], [Name], [DistrictID], [HandoverYear], [Company]) VALUES (CAST(3 AS Decimal(18, 0)), 1, N'<h2><strong style="background-color: rgb(255, 255, 255); font-size: 16px; color: rgb(34, 34, 34); font-family: Helvetica;">Giới thiệu dự án</strong></h2><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">1. Vị trí:</strong></p><p><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Tọa lạc trên đường Tô Hiến Thành giao với Thành Thái, Phường 14, Quận 10, Tp.HCM</span></p><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">2. Tiện ích:</strong><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;"> </span></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Trường mầm non và Trường Tiểu học</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Công viên</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Trung tâm thể dục thể thao (gym, spa, yoga…)</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Quảng trường</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Vườn nướng BBQ, khu ẩm thực</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Thư viện, phòng sinh hoạt chung, đường chạy bộ, bể bơi…</span></li></ul><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">3. Chủ đầu tư:</strong></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Sunshine Group</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Các dự án khác: Sunshine Horizon, Sunshine Royal Garden Sky Villa, Sunshine Boulevard, Sunshine Venicia, Sunshine Mystery Villas, Sunshine Diamond River,...</span></li></ul><p><br></p><p><br></p>', N'Sunshine Continental', CAST(11 AS Decimal(18, 0)), CAST(N'2021-12-31T22:00:00.0000000' AS DateTime2), N'TẬP ĐOÀN SUNSHINE (SUNSHINE GROUP)')
INSERT [dbo].[Project] ([ID], [Status], [Description], [Name], [DistrictID], [HandoverYear], [Company]) VALUES (CAST(4 AS Decimal(18, 0)), 1, N'<p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">1. Vị trí:</strong></p><p><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Tọa lạc tại số 86 đường Cầu Đình, phường Long Phước, quận 9, Tp.HCM.</span></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">30 phút đến sân Bay Quốc Tế Long Thành qua Cao tốc Long Thành - Dầu Giây</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">7 phút đến khu Công nghệ cao trên đường Xa lộ Hà Nội</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">10 phút đến khu Du lịch Suối Tiên</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">20 phút đến Khu thể thao Rạch Chiếc, Bán đảo Thủ Thiêm, trung tâm quận 1</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">700m đến đường Vành Đai 3</span></li></ul><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">2. Tiện ích:</strong></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Kênh cảnh quan chạy quanh dự án</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Khu vực Sân Tennis &amp; Sân chơi trẻ em</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Bến du thuyền</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Clubhouse</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Hồ bơi tràn bờ</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Công viên cây xanh</span></li></ul><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">3. Chủ đầu tư:</strong></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Công Ty Cổ Phần Đầu Tư Kinh Doanh Địa Ốc Hưng Thịnh ( Hưng Thịnh Corp )</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Các dự án khác: Q7 Boulevard, Thi Sách Apartment, Quy Nhơn Melody, Khu đô thị Nam Hùng Vương, Liberty Central Quy Nhơn Beach Hotel,...</span></li></ul><p><br></p>', N'Saigon Garden Riverside Village', CAST(21 AS Decimal(18, 0)), CAST(N'2022-01-01T05:00:00.0000000' AS DateTime2), N'Hưng Hưng Thịnh')
INSERT [dbo].[Project] ([ID], [Status], [Description], [Name], [DistrictID], [HandoverYear], [Company]) VALUES (CAST(5 AS Decimal(18, 0)), 1, N'<p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">1. Vị trí:</strong></p><p><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Tọa lạc tại lô đất S6-1 đường Nguyễn Lương Bằng, Phường Tân Phú, Quận 7, Tp.HCM. Từ vị trí này, bạn sẽ chỉ mất khoảng 5 phút là có thể kết nối đến hồ Bán Nguyệt, cầu Ánh Sao, TTTM Crescent Mall hay bến du thuyền Quận 7.</span></p><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">2. Tiện ích:</strong></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Khu tổ hợp hồ bơi</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Phòng giải trí, phòng chơi trẻ em, phòng golf… </span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">An ninh đa lớp 24/7</span></li></ul><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">3. Chủ đầu tư:</strong></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Công ty TNHH Phát Triển Phú Mỹ Hưng</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Các dự án khác: Khu đô thị sinh thái Hồng Hạc - Xuân Lâm, The Ascentia Phú Mỹ Hưng, The Peak, Hưng Phúc Premier, Công ty TNHH Liên doanh Phú Mỹ Hưng,...</span></li></ul><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">4. Chính sách ưu đãi:</strong></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Tiến độ thanh toán được chia thành 6 đợt</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Vietcombank: Hỗ trợ vay 70% giá trị hợp đồng</span></li></ul><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">5. Quy mô:</strong></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Tổng diện tích: 5.880 m²</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Quy mô: 2 Block cao 24 tầng (2 tầng hầm xe hơi, 3 tầng hầm xe máy và 2 tầng Shophoue)</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Số lượng căn hộ: 242 căn</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Sản phẩm: căn hộ 2-3 phòng ngủ, căn Penthouse, shophouse</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Diện tích căn hộ: 75-200m2</span></li></ul><p><br></p>', N'The Antonia', CAST(19 AS Decimal(18, 0)), CAST(N'2022-01-01T05:00:00.0000000' AS DateTime2), N'LIÊN DOANH PHÚ MỸ HƯNG')
INSERT [dbo].[Project] ([ID], [Status], [Description], [Name], [DistrictID], [HandoverYear], [Company]) VALUES (CAST(6 AS Decimal(18, 0)), 1, N'<p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">1. Vị trí:</strong></p><p style="text-align: justify;"><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Nội khu dự án Vinhomes Grand Park, liền kề phân khu The Rainbow ngay mặt đường Nguyễn Xiển, Phường Long Thạnh Mỹ, Quận 9, TP HCM.</span></p><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">2. Tiện ích:</strong></p><ul><li style="text-align: justify;"><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Phía Đông: Kết nối tuyến giao thông Vành Đai 3 trên cao đi ngang dự án. Liền kề với phân khu 3, Vincom Mega Mall, Công viên Grand Park 36ha.</span></li><li style="text-align: justify;"><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Phía Tây: Liền kề khu dân cư hiện hữu.</span></li><li style="text-align: justify;"><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Phía Nam: Hướng Về Sông Tắc, đồng thời liền kề liền kề phân khu The Rainbow</span></li><li style="text-align: justify;"><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Phía Bắc: Liền kề khu dân cư Phước Thiện.</span></li></ul><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">3. Chủ đầu tư:</strong></p><p><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Tập đoàn Vingroup.</span></p><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">4. Chính sách ưu đãi:</strong></p><p><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Ngân hàng Techcombank hỗ trợ vay 70%, thời hạn 35 năm.</span></p><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">5. Quy mô dự án</strong><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">:</span></p><p><br></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">21 toà căn hộ.</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Cao 25-35 tầng, 2 hầm xe. Diện tích căn hộ: 27 – 108m2 (1 đến 3PN+1).</span></li></ul><p><br></p><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">6. Tiến độ dự án</strong><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">:</span></p><p style="text-align: justify;"><br></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Đã hoàn thiện hầm móng.</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Thời gian bàn giao dự kiến: Từ tháng 11 năm 2021.</span></li></ul><p><br></p>', N'The Origami – Vinhomes Grand Park', CAST(21 AS Decimal(18, 0)), CAST(N'2021-01-01T05:00:00.0000000' AS DateTime2), N'Tập đoàn Vingroup')
INSERT [dbo].[Project] ([ID], [Status], [Description], [Name], [DistrictID], [HandoverYear], [Company]) VALUES (CAST(8 AS Decimal(18, 0)), 1, N'<p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">1.Vị trí:</strong></p><p><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Vincity Quận 9 tọa lạc ngay trục đường Nguyễn Xiển trung tâm Quận 9. Giáp các trục đường lớn như: Cao tốc Sài Gòn – Dầu Giây, đường Mai Chí Thọ, Vành đai 2…. tuyến Metro số 1</span></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">10 phút để tới khu du lịch Suối Tiên</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">5 phút để tới khu trung tâm công nghệ cao của Tp.Hồ Chí Minh</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">10 phút để tới khu thể thao sân Golf Rạch Chiếc</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">15 phút để đến trung tâm Quận 2.</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">6 phút để đến AEON Mall và Trường Đại Học Fulbright tương lai.</span></li></ul><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">2.Tiện ích:</strong></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Hệ Thống trường đào tạo liên cấp quốc tế Vinschool</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Hệ thống bệnh viện chăm sóc sức khỏe Vinmec</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Hệ thống công viên ngoài trời với khu chạy bộ, khu thư giản, khu tổ chức sự kiện, khu thể dục thể thao, khu ngắm cảnh ven sông</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Hệ thống trung tâm thương mại: Nhà hàng, rạp chiếu phim, khu ẩm thực, khu mua sắm, khu giải trí trong nhà…</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Hệ thống quản lý, dịch vụ căn hộ tại Vinhomes và nhiều tiện ích nội khu khác</span></li></ul><p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">3.Chủ đầu tư:</strong></p><ul><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Tập đoàn Vingroup - Chủ đầu tư uy tín</span></li><li><span style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif;">Dự án khác:Khu Đô thị Sinh thái Vinhomes Riverside, Trung tâm thương mại Vincom Center Bà Triệu, Vincom Center Đồng Khởi, Vincom Center Long Biên… </span></li></ul><p><br></p>', N'Vinhomes Grand Park', CAST(21 AS Decimal(18, 0)), CAST(N'2021-01-01T05:00:00.0000000' AS DateTime2), N'Tập đoàn Vingroup')
