INSERT [dbo].[Property] ([ID], [LocationID], [BrokerID], [CreateDate], [LastUpdateDate], [Status], [Description], [RejectReason], [Type], [Name], [ProjectId], [Direction], [Floor], [FloorArea], [Area], [Frontage], [Certificates], [Vertical], [Horizontal], [RoadWidth], [RentalCondition], [RentalTerm], [DepositTerm], [PaymentTerm], [Price], [NumberOfFrontage]) VALUES (CAST(3 AS Decimal(18, 0)), CAST(3 AS Decimal(18, 0)), CAST(1 AS Decimal(18, 0)), CAST(N'2022-12-09T21:17:44.2621579' AS DateTime2), CAST(N'2022-12-16T13:57:08.9121871' AS DateTime2), 3, N'<p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">Chính thức CĐT Keppel Land tung siêu phẩm mở cho thuê trực tiếp 9 căn cuối cùng nhà phố thương mại đỉnh nhất phía Nam Sài Gòn - mặt tiền Nguyễn Hữu Thọ.</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">Vị trí: Mặt tiền Nguyễn Hữu Thọ, Phước Kiển, Nhà Bè, Hồ Chí Minh.</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- Hiện trạng: Đang xây dựng.</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- Đặc điểm thiết kế cực hiện đại và đặc biệt: 2 mặt tiền vừa ở vừa kinh doanh.</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- Tổng số lượng chỉ 43 căn nhà ở thương mại (sở hữu lâu dài).</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- Mở bán chính thức từ ngày 10/9 /2022: Hiện tại còn 9 căn.</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- Diện tích đất: 7x29m, 7x30m, 8.2mx30m.</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- Xây dựng: 1 trệt + 2 lầu + 1 sân thượng (1 căn nhưng 2 mặt tiền).</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- Dự án thuộc khu đô thị Celesta: Celesta Rise, Celesta Heights, Celesta Gold, Celesta Avenue.</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- Bàn giao thô bên trong, hoàn thiện thiết kế hiện đại bên ngoài (Hình ảnh dính kèm topic).</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- Celesta Avenue là một trong những dự án Nhà phố hiếm hoi được CĐT Keppel Land xây dựng phát triển và đặt tâm huyết vào concept, cũng như lanscape - Dự kiến sẽ là một siêu phẩm đỉnh cao tại khu vực phía Nam.</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- Diện tích đất: 196m², 421m².</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- DTXD: 356m², 530m².</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">* Đặc biệt hơn, đó là chính sách bán hàng thanh toán:</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- Lịch thanh toán là 30% nhận nhà.</span></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Roboto Regular&quot;; font-size: 14px; background-color: rgb(255, 255, 255);">- Dự kiến ngân hàng liên kết cho vay: Vietcombank, HSBC, UOB, Holeong, Standa charter.</span></p>', N'', 0, N'KEPPEL LAND CHÍNH THỨC CHO THUÊ 5 CĂN CUỐI NHÀ PHỐ THƯƠNG MẠI ĐỈNH NHẤT PHÍA NAM SG-TT 30% NHẬN NHÀ', NULL, 1, N'1,2,3', 180, 196, 10, 0, 13, 15, 20, N'Không kinh doanh cafe', N'Dài hạn từ 5 năm trở lên', N'1 năm', N'1 năm tăng 10%', CAST(30000000 AS Decimal(18, 0)), 1)
