ua từ chủ đầu tư.</span></p><p><span style="font-family: &quot;Roboto Regular&quot;; font-size: 14px; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);">* Thiết kế 1 trệt 1 lầu vừa kết hợp kinh doanh vừa để ở.</span></p><p><span style="font-family: &quot;Roboto Regular&quot;; font-size: 14px; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);">* Diện tích 98m 115m 131m 160m 180m 248m 240m.</span></p><p><span style="font-family: &quot;Roboto Regular&quot;; font-size: 14px; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);">* Cung ứng cho 10.000 cư dân về đây sinh sống và làm việc.</span></p><p><span style="font-family: &quot;Roboto Regular&quot;; font-size: 14px; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);">* Chuỗi các tiện ích nội khu làm gia tăng giá trị: Trường học các cấp,...</span></p><p><span style="font-family: &quot;Roboto Regular&quot;; font-size: 14px; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);">* Vị trí kết nối trung tâm hành chính.</span></p>', N'', 0, N'Shophouse vừa ở vừa kinh doanh, liền kề quận Gò Vấp', NULL, 4, N'trệt, 2, 3', 110, 115, 10, 0, 10, 11, 15, N'Không kinh doanh bếp gas', N'Dài hạn từ 5 năm trở lên', N'3 tháng tùy theo thời gian thuê', N'1 năm tăng 10%', CAST(69000000 AS Decimal(18, 0)), 3)
